import BubsbutterCup from './components/BubsbutterCup';

function Bubsbutter(props) {
  const Bubsbutter = [
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2020, 7, 14)
    },
    { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28)
    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(2021, 5, 12)
    }
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <BubsbutterCup>
        title ={Bubsbutter[0].title} amount={Bubsbutter[0].amount} date =
        {Bubsbutter[0].date}
      </BubsbutterCup>
      <BubsbutterCup>
        title ={Bubsbutter[1].title} amount={Bubsbutter[1].amount} date =
        {Bubsbutter[1].date}
      </BubsbutterCup>
      <BubsbutterCup>
        title ={Bubsbutter[2].title} amount={Bubsbutter[2].amount} date =
        {Bubsbutter[2].date}
      </BubsbutterCup>
      <BubsbutterCup>
        title ={Bubsbutter[3].title} amount={Bubsbutter[3].amount} date =
        {Bubsbutter[3].date}
      </BubsbutterCup>
      <BubsbutterCup></BubsbutterCup>
    </div>
  );
}

export default App;
